INSERT INTO `trnagreement` (`AgreementId`, `AgreementTypeId`, `ContractNo`, `VendorId`, `Date`, `ContractAmount`, `WithPpn`, `ContractAmountDescription`, `ContractPeriodFrom`, `ContractPeriodTo`, `ScopeOfWork`, `BasicOfWorkExecution`, `PaymentTypeId`, `PaymentMethod`, `ImplementPeriode`, `ImplementInsurrance`, `Miscellanous`, `ReceivedAgreement`, `ReceivedAgreementTitle`, `Sender1Name`, `Sender1Title`, `Sender2Name`, `Sender2Title`, `PrintStatus`, `CreatedDate`, `CreatedByUserId`, `LastChangedDate`, `LastChangedByUserId`, `DeletedDate`, `DeletedUserId`) VALUES
	('595c75d61a43c595c75d61a493', 4, '005/SPSA/PLTB TOLO/VI/2017', '331', '2017-06-01', '12100000', 1, '595c75d61a43c595c75d61a493', '2017-05-01', '2017-06-02', '<p>1. Ahmad Julaziz menyewakan alat sesuai dengan spesifikasi yang diberikan oleh PT. PP (Persero) Tbk. Divisi EPC dan bertanggung jawab untuk memobilisasi alat dari lokasi garasi Ahmad Julaziz ke lokasi proyek PLTB Tolo Windfarm 76 MW dan mendemobilisasi alat kembali ke garasi.</p>\r\n<p>2. Ahmad Julaziz bertanggung jawab atas biaya perawatan dan perbaikan alat apabila terjadi kerusakan</p>\r\n<p>3. Ahmad Julaziz bertanggung jawab untuk menyediakan operator untuk mengoperasikan alat yang dimaksud di lokasi proyek PLTB Tolo Windfarm 76 MW</p>\r\n<p>4. Ahmad Julaziz bertanggung jawab untuk mengurus perijinan operasional alat dan operator alat di lokasi proyek PLTB Tolo Windfarm 76 MW sesuai dengan ketentuan peraturan daerah setempat.</p>\r\n<p>5. Ahmad Julaziz bertanggung jawab untuk menyediakan spare part alat, oli pelumas, dan grease</p>\r\n<p>6. Ahmad Julaziz bertanggung jawab untuk mengganti alat yang rusak lebih dari 2 (dua) minggu dengan unit lain yang memiliki spesifikasi yang sama dengan alat yang yang rusak, sesuai dengan kesepakatan kedua belah pihak</p>\r\n<p>7. Jika alat yang rusak belum diganti setelah lebih dari 2 minggu sesuai dengan pasal 9.6 diatas, maka Ahmad Julaziz akan dikenakan denda keterlambatan sebesar 0,1 % (satu per mil) perhari keterlambatan dengan batas maksimal 10% (sepuluh persen) dari nilai kontrak.</p>\r\n<p>8. Ahmad Julaziz dilarang memindahkan alat dari lokasi proyek PLTB Tolo Windfarm 76 MW tanpa seizin PT. PP (Persero) Tbk. Divisi EPC</p>\r\n<p></p>\r\n<p></p>', '<p>-</p>', 5, '<p>Maksimum 30 hari atau T/T 30 hari setelah invoice diterima</p>', '<p>Sewa alat dimulai dari tanggal 1 Mei 2017 - 2 Juni 2017</p>', '<p>1. Ahmad Julaziz memberikan jaminan bahwa alat yang dikirim ke lokasi proyek sesuai dengan spesifikasi yang diminta PT. PP (Persero) Tbk. Divisi EPC dan alat tersebut dalam kondisi baik dan siap pakai.</p>\r\n<p>2. Ahmad Julaziz memberikan jaminan bahwa alat yang disewakan tidak sedang berada dalam masalah hukum maupun sengketa kepemilikan.</p>', '<p>1. Ahmad Julaziz dan PT. PP (Persero) Tbk. menyatakan bahwa para penandatangan Perjanjian ini adalah orang yang memiliki kewenangan bertindak mewakili, untuk dan atas nama perseroan berdasarkan Anggaran Dasar Perusahaan</p>\r\n<p>2. Ahmad Julaziz dan PT. PP (Persero) Tbk. menjamin bahwa dirinya adalah badan hukum yang didirikan secara sah dan telah mempunyai izin-izin yang diperlukan untuk menjalankan bidang usahanya dari Pemerintah terkait.</p>\r\n<p>3. Surat Perjanjian Sewa Alat ini menjadi satu kesatuan dan bagian yang tidak terpisahkan dengan General Terms and Conditions. Hal - hal yang tidak diatur dalam Surat Perjanjian Sewa Alat ini maka yang berlaku adalah yang diatur dalam General Terms and Conditions (terlampir)</p>\r\n<p></p>', 'AHMAD JULAZIZ', 'PEMILIK ALAT', 'M SYAIFULHAQ', 'SEM', 'BARKAH WIDI S', 'PM', 0, '2017-07-05 12:15:02', '49', '2017-07-13 15:27:10', '1', NULL, NULL),
