INSERT INTO `trnspk` (`SpkId`, `SpkNo`, `ProyekId`, `SpkNoUrut`, `DateSpk`, `Foreman`, `Address`, `WorkType`, `WorkPlace`, `TotalValue`, `Giver1`, `Giver2`, `Term`, `LockDate`, `LockByUserId`, `Approval1Status`, `Approval1Note`, `Approval1Date`, `Approval1Ttd`, `Approval2Status`, `Approval2Note`, `Approval2Date`, `Approval2Ttd`, `CreatedDate`, `CreatedByUserId`, `LastChangedDate`, `LastChangedByUserId`, `DeletedDate`, `DeletedUserId`) VALUES
	('5959e100252f55959e1002533d', '0001/EPC/PP-717003/VII/2017', 'aslklkluheyhdnklsiuwtnmdbt', '0001', '0000-00-00', 'BUDI EKO PRASETYO', 'JAKARTA', 'Sewa mess dan perbaikan', '', '0.00', '', '', '<p>1. Opnam pembayaran sesuai dengan progress dilapangan (Berita Acara Lapangan)</p>\r\n<p>2. Lokasi harus selalu bersih dan rapih/housekeeping</p>\r\n<p>3. Bersedia kerja lembur</p>\r\n<p>4. Pekerjaan sesuai RKS, Shop Drawing dan bisa diterima oleh PT.PP (Persero) Tbk dan owner (PLN).</p>\r\n<p>5. Harga Satuan tersebut sudah termasuk :</p>\r\n<ul xss=removed>\r\n<li>a. Alat bantu/peralatan, listrik kerja, bahan bakar dan genset</li>\r\n<li>b. Mobilisasi dan demobilisasi peralatan dan pekerja ke site serta penginapan pekerja</li>\r\n<li>c. PPh dan pajak lainnya.</li>\r\n</ul>\r\n<p>6. APD (Alat Pelindung Diri) disediakan oleh Pemborong dan wajib digunakan selama berada dilingkungan proyek.</p>\r\n<p>7. Berkas penagihan 100% dimasukkan setelah progress pekerjaan mencapai 100?n dinyatakan dalam Berita Acara Penyelesaian dan Serah Terima Pekerjaan</p>\r\n<p>8. Pembayaran dilakukan dengan sistem reguler T/T (telegraphic transfer) :</p>\r\n<ul xss=removed>\r\n<li>a. 5% Site Mobilization</li>\r\n<li>b. 90% Sesuai Progres Pekerjaan Lapangan (Berita acara ditandatangani kedua belah pihak)</li>\r\n<li>c. 5% Retensi dibayarkan setelah waktu pemeliharaan selesai (12 bulan) dan menyerahkan BAST kedua.</li>\r\n</ul>\r\n<p>9. Pembayaran maksimal 60 (enam puluh) hari kelender setelah invoice masuk lengkap dan benar dan akan dipotong Pph 4%</p>\r\n<p>10. Pelaksanaan pekerjaan sampai dengan tanggal 15 Juni 2016</p>', '2017-07-03 13:27:46', '48', 0, NULL, '0000-00-00 00:00:00', '', 0, NULL, '0000-00-00 00:00:00', '', '2017-07-03 13:15:28', 48, NULL, NULL, NULL, NULL),
